import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import { Nav, Navbar } from 'react-bootstrap';
import './Nav_Bar.css';

const Nav_Bar = () => {
  return (
    <div>
      <Navbar bg="my-Blue" variant="dark" sticky="top">
        <Navbar.Brand href="">
          <img src="./images/icons/favicon.ico" width="30px" height="30px" className="d-inline-block align-top" /> Present Simple
        </Navbar.Brand>
        <Nav>
          <Nav.Link></Nav.Link>
        </Nav>
      </Navbar>
      <div id="content">this is a content.</div>
    </div>
  );
};

export default Nav_Bar;
